import React, { Component } from "react";
import ReservationInfo from "./ReservationInfo";
import { connect } from "react-redux"
import { getAllUserReservations } from "../../../store/actions/PurchasesActions"


class UserReservations extends Component {

    state = {
        duzina: -1

    }

    componentDidMount() {

        this.props.getAllUserReservations(2);

    }

    componentWillUpdate() {
        if (userReservations) {
            this.setState({
                duzina: this.props.userReservations.filter(item => item.carReservationId != null).length
            }
            )
        }
    }

    render() {
        return (

            <div>

                <h2 className="center red-text lighten-1">Veljko's reservations</h2>

                {

                    this.props.userReservations && this.props.userReservations.length == this.state.duzina ?
                        this.props.userReservations.map(reservation => {

                            return (
                                <ReservationInfo reservation={reservation} carReservations={this.props.carReservations} />
                            );
                        })
                        :
                        ''



                }



            </div>

        );
    }

};

const mapStateToProps = (state) => {
    return {
        userReservations: state.purchases.userReservations,
        rentCarReservations: state.purchases.rentCarReservations
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        getAllUserReservations: (id) => dispatch(getAllUserReservations(id))
    }
}



export default connect(mapStateToProps, mapDispatchToProps)(UserReservations);
